		//     
		function create_aliens() {
			//checkbtn.removeEventListener('click', sound_func("background_sound"));
			for (i = 0; i < myGame.length; i++) {
		
				if (i % 2) {
					pos = 50;
				} else {
					pos = -50;
				}
		
				if (i <= 10) {
					alien1_x = (stageW / 2) + pos * (i - 5) + 3;
					alien1_y = (stageH) - ((i - 3) * 2) - 70;
					if (i <= 5) {
						alien1_x = (stageW / 2) + pos * i + 5;
						alien1_y = (stageH) + (i * 2) - 50;
					}
				} else {
					alien1_x = (stageW / 2) + pos * (i / 2.5);
					alien1_y = (stageH) - ((i - 3) * 2) - 30;
				}
		
				var alien1 = new lib.alien_1;
				stage.addChild(alien1);
				alien1.x = alien1_x;
				alien1.y = alien1_y;
				alien1.name = "alien" + i;
				alienArray[i] = alien1.name;
			}
			nextbtn.addEventListener("click", changePlayer);
			changePlayer();
		}
		
		function player_fade() {
			//      
			home = stage.getChildByName("home" + player);
			home.gotoAndStop(1);
			home.alpha = 0.2;
			sign = stage.getChildByName("sign_" + player);
			sign.gotoAndStop(1);
			sign.alpha = 0.2;
			sign.txt.text = "";
			sign.txt2.text = "";
			sign.removeChild(clock);
			//     
			for (i = 0; i <= myGame.length; i++) {
				otherAlien = stage.getChildByName(alienArray[i]);
				otherAlien.gotoAndStop(0);
			}
		}
		
		//     
		function changePlayer() {
			timeIsUp = false;
			//arrowOn = false;
			player_fade();
			if (player == 1) {
				player1Time = playerTime;
				playerTime = player2Time;
				player1Qnum = playerQnum;
				playerQnum = player2Qnum;
				player = 2;
				//     
				score1 = score;
				score = score2;
				playerName = player2;
				otherplayerName = player1;
				spaceship.gotoAndStop(2);
			} else {
				player2Time = playerTime;
				playerTime = player1Time;
				player2Qnum = playerQnum;
				playerQnum = player1Qnum;
				player = 1;
				//     
				score2 = score;
				score = score1;
				playerName = player1;
				otherplayerName = player2;
				spaceship.gotoAndStop(1);
			}
			//      
			stage.getChildByName("home" + player).gotoAndStop(2);
			stage.getChildByName("home" + player).alpha = 1;
			stage.getChildByName("sign_" + player).gotoAndStop(2);
			stage.getChildByName("sign_" + player).alpha = 1;
			if (myGame.length >= 1) {
				next_question();
			} else {
				endFunc();
			}
		
		}
